Para participar do SUSTENTARE como parceiro do programa é muito simples, basta seguir os seguintes passos:
 

<strong>1.</strong> Preencher o cadastro no programa através do link: <a href="http://sustentare.des.intra.rs.gov.br/cadastrar-no-programa">http://sustentare.des.intra.rs.gov.br/cadastrar-no-programa</a>;

<strong>2.</strong> Preencher a ficha de solicitação de equipamentos desejados, conforme o tipo: Ocioso, Recuperável e Inservível. Os modelos de fichar encontram-se no link: <a href="http://sustentare.des.intra.rs.gov.br/documentos-para-download">http://sustentare.des.intra.rs.gov.br/documentos-para-download</a>, e devem ser baixados conforme o tipo de material desejado: Ocioso, Recuperável e Inservível;

<strong>3.</strong> Enviar a ficha devidamente preenchida, através do link: <a href="http://sustentare.des.intra.rs.gov.br/solicitar-equipamentos">http://sustentare.des.intra.rs.gov.br/solicitar-equipamentos</a>;

<strong>4.</strong> Emitir o Certificado de Destinação Final de Resíduos, CDF, que deve ser entregue ao Doador. Os modelos do CDF encontram-se disponíveis para download no link: <a href="http://sustentare.des.intra.rs.gov.br/documentos-para-download">http://sustentare.des.intra.rs.gov.br/documentos-para-download</a>, e devem ser baixados conforme o tipo de material recolhido: Ocioso, Recuperável e Inservível.

A definição dos tipos de solicitação segue o seguinte padrão:
<ul><li><strong>Ocioso</strong>: Equipamentos que estão em condições de uso e não servem mais ao doador;</li>
<li><strong>Recuperável</strong>: Equipamentos que necessitam, e possuem condições de reparo;</li>
<li><strong>Inservível</strong>: Equipamentos sem condições de reparo que têm como destino o desmonte para o correto descarte dos materiais;</li>
</ul>
